--prompt Created by JK on Actualizar
set feedback off
set define off

--Tabla para guardar las emisiones GEI cuando una auditoría se encuentra en Auditada Implenetada o verificada
prompt Creating mrvmm.T_GEND_INDICADOR_AIF ...
CREATE TABLE mrvmm.T_GEND_INDICADOR_AIF 
(	
  ID_INICIATIVA NUMBER, 
	ID_INDICADOR NUMBER, 
	ID_ESTADO NUMBER, 
	AUDITADO NUMBER, 
	IMPLEMENTADO NUMBER, 
	VERIFICADO NUMBER, 
	ENERGIA_AUDITADO NUMBER, 
	ENERGIA_IMPLEMENTADO NUMBER, 
	ENERGIA_VERIFICADO NUMBER, 
	FLAG_ESTADO VARCHAR2(1 BYTE) DEFAULT '1', 
  FOREIGN KEY (ID_INICIATIVA) REFERENCES mrvmm.T_GENM_INICIATIVA (ID_INICIATIVA),
	PRIMARY KEY (ID_INICIATIVA, ID_INDICADOR)
);

--Tabla para guardar la informacion de una empresa auditada
prompt Creating mrvmm.T_GEND_INICIATIVA_AUDITORIA...
create table mrvmm.T_GEND_INICIATIVA_AUDITORIA (
  ID_AUDITORIA NUMBER,
  ID_INICIATIVA NUMBER,
  SECTOR_INST VARCHAR2(3),
  INSTITUCION_AUDITADA VARCHAR2(130),
  TIPO_AUDITORIA VARCHAR2(10),
  DESCRIPCION_TIPO_AUDITORIA VARCHAR2(600),											
  AUDITOR VARCHAR2(80),
  NOMBRE_INSTITUCION VARCHAR2(130),
  FECHA_AUDITORIA VARCHAR2(20),  
  FLAG_ESTADO VARCHAR2(1) DEFAULT '1',
  USUARIO_REGISTRO NUMBER,
  FECHA_REGISTRO DATE,
  USUARIO_MODIFICA NUMBER,
  FECHA_MODIFICA DATE,
  PRIMARY KEY (ID_AUDITORIA),
  FOREIGN KEY (ID_INICIATIVA) REFERENCES mrvmm.T_GENM_INICIATIVA (ID_INICIATIVA)
)
;

--Tabla para guardar la información de la inversión con su moneda y el anio de una accion de mitigacion
prompt Creating mrvmm.T_GEND_INICIATIVA_INVERSION...
CREATE TABLE mrvmm.T_GEND_INICIATIVA_INVERSION (
ID_INICIATIVA NUMBER,
ANIO NUMBER,
MONEDA NUMBER,
INVERSION NUMBER(32,6),
USUARIO_REGISTRO NUMBER,
FECHA_REGISTRO DATE,
USUARIO_MODIFICA NUMBER,
FECHA_MODIFICA DATE,
FOREIGN KEY (ID_INICIATIVA) REFERENCES mrvmm.T_GENM_INICIATIVA (ID_INICIATIVA),
PRIMARY KEY (ID_INICIATIVA, ANIO)
);

--Actualizacion del tamanio de las columnas ADJUNTO para el nombre serializado del archivo y ADJUNTO_BASE para el nombre real del archivo
prompt Updating mrvmm.T_GEND_INICIATIVA_SUSTENTA...
ALTER TABLE mrvmm.T_GEND_INICIATIVA_SUSTENTA MODIFY ADJUNTO VARCHAR2(100);
ALTER TABLE mrvmm.T_GEND_INICIATIVA_SUSTENTA MODIFY ADJUNTO_BASE VARCHAR2(100);

--Tabla con informacion predeterminada de los parametros del Reporte Minam 
prompt Creating mrvmm.T_GEND_PARAMETRO_REPORT_MINAM...
create table mrvmm.T_GEND_PARAMETRO_REPORT_MINAM
(
  id_parametro_r          NUMBER not null,
  id_medmit               NUMBER not null,
  nombre_parametro        VARCHAR2(500),
  unidad                  VARCHAR2(500),
  descripcion_parametro   VARCHAR2(500),
  frecuencia              VARCHAR2(500),
  fuente                  VARCHAR2(500),
  valor                   VARCHAR2(500),
  descripcion_metodologia VARCHAR2(500),
  control_calidad         VARCHAR2(500),
  aseguramiento_calidad   VARCHAR2(500),
  proposito               VARCHAR2(500),
  responsable             VARCHAR2(500),
  comentarios             VARCHAR2(500),
  orden                   NUMBER,
  flag_estado             VARCHAR2(1) default '1'
)
;
alter table mrvmm.T_GEND_PARAMETRO_REPORT_MINAM
  add primary key (ID_PARAMETRO_R, ID_MEDMIT);
alter table mrvmm.T_GEND_PARAMETRO_REPORT_MINAM
  add foreign key (ID_MEDMIT)
  references mrvmm.T_MAE_MEDMIT (ID_MEDMIT);
 
