--Actualizacion del nombre de las medidas de mitigacion, asi como su descripcion
prompt Loading mrvmm.T_MAE_MEDMIT...
update mrvmm.T_MAE_MEDMIT set nombre_medmit = 'Etiquetado de eficiencia energética - EEE', descripcion_medmit = 'Esta medida propone que los equipos que requieran suministros energéticos incluyan en sus etiquetas, envases, empaques y publicidad, una etiqueta de eficiencia energética a través de la cual el consumidor pueda conocer el consumo de energía y la eficiencia energética del producto para la toma de decisión de consumo, reduciendo así las emisiones de GEI debido a la reducción del consumo de energía asociada a la mejora de eficiencia de los nuevos equipos a ser adquiridos por los consumidores. La medida se enmarca en el Reglamento Técnico sobre el etiquetado de eficiencia energética para equipos energéticos, aprobado mediante Decreto Supremo N°009-2017-EM.' where id_medmit = 1;
update mrvmm.T_MAE_MEDMIT set nombre_medmit = 'Eficiencia energética en el sector industrial - EESI', descripcion_medmit = 'Esta medida de mitigación, propuesta por el Ministerio de Energía y Minas, propone la implementación de medidas de eficiencia energética en empresas del sector industrial fomentando la competitividad de la economía nacional y reduciendo el impacto ambiental negativo del uso y consumo de los energéticos, y de esta forma contribuir  con la reducción de emisiones de GEI. Esta medida se enmarca en la Ley de Promoción del Uso Eficiente de la Energía, Ley N°27345, y su Reglamento aprobado por Decreto Supremo N°053-2007-EM. Así, se prevé considerar el recambio de motores y calderas, una vez que se viabilice el Fondo de Financiamiento a la Eficiencia Energética (FOFEE)' where id_medmit = 2;
update mrvmm.T_MAE_MEDMIT set nombre_medmit = 'Eficiencia energética en el sector comercial - EESC', descripcion_medmit = 'Medida que propone promover la racionalización del consumo de energía en el sector comercial de servicios.' where id_medmit = 3;
update mrvmm.T_MAE_MEDMIT set nombre_medmit = 'Auditorías energéticas en el sector público - AESP', descripcion_medmit = 'Medida que propone implementar acciones que contribuyan a reducir el consumo de energía sin que estas acciones afecten la calidad de los servicios prestados y recibidos en las entidades del sector público cuya facturación mensual por consumo de energía eléctrica sea mayor de cuatro (4) unidades impositivas tributarias (UIT), reduciendo así las emisiones de GEI debido a la reducción del consumo energético. Asimismo, prevé que en un futuro las auditorías energéticas puedan desarrollarse para el sector privado, bajo el mecanismo de un fondo de eficiencia energética.' where id_medmit = 4;
update mrvmm.T_MAE_MEDMIT set nombre_medmit = 'Transformación del mercado de iluminación en el sector residencial - ISR', descripcion_medmit = 'Medida que promueve la sustitución de lámparas de baja eficiencia por tecnologías más eficientes de iluminación, reduciendo las emisiones de GEI debido al menor uso de energía, y generando la transformación hacia un mercado de iluminación más eficiente, cuyo principal objetivo es promover el uso de lámparas que permitan un uso eficiente de la energía en el país, sin menoscabar la calidad de la iluminación, considerando los beneficios económicos, ambientales y sociales que se tendrían en el país. La medida de mitigación propone dos fases: i) el programa de distribución de un millón y medio de lámparas energéticamente más eficientes a hogares de menores ingresos como meta al 2019, en el marco del Programa Anual de Promociones 2018, aprobado mediante Resolución Ministerial N° 021-2018-MINEM/DM, de acuerdo a lo establecido en el Plan de Acceso Universal a la Energía 2013-2022, aprobado con Resolución Ministerial N° 203-2013-MINEM-DM; y ii) la Estrategia de Iluminación del Perú, cuyo objetivo es incrementar la participación de las lámparas eficientes en el mercado de iluminación nacional, reduciendo el consumo de energía y por ende también reduciendo las emisiones de gases de efecto invernadero (como el CO2).' where id_medmit = 5;
update mrvmm.T_MAE_MEDMIT set nombre_medmit = 'Reemplazo de lámparas de baja eficiencia por lámparas LED en el sector público - LSP', descripcion_medmit = 'Reemplazo de lámparas de baja eficiencia por lámparas LED en el sector público reduciendo así el consumo de energía y por ende reduciendo también las emisiones de GEI, con el objetivo de impulsar el uso de lámparas y otros equipos de iluminación LED en todas las instituciones públicas. La medida se implementa a través de las fichas de homologación de tecnología LED, aprobadas por el MINEM, y que son instrumentos que permiten el reemplazo de luminarias menos eficientes por lámparas y otros equipos de iluminación LED en los procesos de compras públicas, lo que permite además la inclusión de estas tecnologías en la implementación de nuevos establecimientos estatales. Impulsar el uso de lámparas eficientes en el sector público a través de las Fichas de Homologación de lámparas de tecnología LED. Aplica para lámparas LED.' where id_medmit = 6;
update mrvmm.T_MAE_MEDMIT set nombre_medmit = 'Reemplazo de lámparas de alumbrado público de vapor de sodio de alta presión (VSAP) por lámparas LED - LAP', descripcion_medmit = 'Medida que promueve la implementación de lámparas de alta eficiencia en el alumbrado público reduciendo las emisiones de GEI debido al menor uso de energía, en el marco del Plan de Acceso Universal a la Energía (RM N°203-2013-MINEM/DM) y en donde se incluye el reemplazo de 100,000 lámparas de vapor de sodio de alta presión (VSAP) en alumbrado público por lámparas LED o de inducción, priorizando zonas vulnerables. Además, contempla una segunda fase a través de la implementación de las fichas de homologación de alumbrado público.' where id_medmit = 7;
update mrvmm.T_MAE_MEDMIT set nombre_medmit = 'Cocción limpia - CL', descripcion_medmit = 'Implementación y sostenibilidad de tecnologías de cocción limpia (cocinas mejoradas y cocinas a gas licuado de petróleos) en zonas rurales, reemplazando aquellas cocinas o tecnologías convencionales (fogón abierto) poco eficientes en el ámbito rural, con lo cual se reducirá los consumos de combustibles empleados en cocinas tradicionales, tales como leña y carbón vegetal, reduciendo así emisiones de gases de efecto invernadero (GEI) y los efectos nocivos a la salud asociados a las emisiones gaseosas y del material particulado restante de la combustión.' where id_medmit = 8;
update mrvmm.T_MAE_MEDMIT set nombre_medmit = 'Suministro de electricidad con recursos energéticos renovables en áreas no conectadas a la red - ER', descripcion_medmit = 'Llevar el servicio de electricidad a usuarios ubicados en áreas no conectadas a la red eléctrica utilizando como fuente de generación los recursos energéticos renovables (RER), mediante la instalación de sistemas fotovoltaicos (paneles solares), con lo cual se reducirán las emisiones de gases de efecto invernadero (GEI) al sustituir el uso de combustibles fósiles en los hogares para generar electricidad, por una energía eléctrica con fuentes renovables que no produce emisiones.' where id_medmit = 9;
update mrvmm.T_MAE_MEDMIT set nombre_medmit = 'Combinación de energías renovables - RERC', descripcion_medmit = 'Aumentar la participación de los Recursos Energéticos de fuentes Renovables (RER) en la matriz energética nacional en un 6.8% en el año 2030, reduciendo la proporción de la energía producida en base a la quema de combustibles fósiles, lo cual generará la reducción de emisiones de gases de efecto invernadero (GEI). Asimismo, la medida incluye la implementación de las centrales hidroeléctricas con una capacidad instalada menor a 20 MW.' where id_medmit = 10;
update mrvmm.T_MAE_MEDMIT set nombre_medmit = 'Generación distribuida - GD', descripcion_medmit = 'Medida que abarca toda instalación de generación eléctrica que inyecte energía eléctrica a la red eléctrica está conectada directamente a la Red de Distribución.' where id_medmit = 11;
update mrvmm.T_MAE_MEDMIT set nombre_medmit = 'Promoción de vehículos eléctricos - PVE', descripcion_medmit = 'Medida que propone reemplazar la matriz energética utilizada en el transporte, la cual utiliza predominantemente combustibles fósiles (gasolina, diésel, gas licuado de petróleo y gas natural vehicular), mediante una mayor participación de vehículos eléctricos en el parque vehicular, contribuyendo al cumplimiento del Plan Energético Nacional 2014-2025 y reduciendo las emisiones de gases de efecto invernadero (GEI) gracias al reemplazo o al desplazamiento de vehículos que consumen gasolina o diésel por nuevos vehículos eléctricos. La meta trazada para esta medida de mitigación en una primera etapa se da bajo 2 acciones: i) la introducción de ómnibus eléctricos y ii) introducción de vehículos livianos eléctricos.' where id_medmit = 12;
commit;
prompt 12 records loaded

