--Actualizacion del tamanio de la columna VALOR 
--Incorporacion de las columnas flag_revision para indicar si un detalle de la accion de mitigacion fue revisado y la columna flag_verificacion para indicar si fue verificado
prompt Updating mrvmm.T_MAEM_INDICADOR_DATA...
ALTER TABLE mrvmm.T_MAEM_INDICADOR_DATA MODIFY VALOR VARCHAR2(1000);
ALTER TABLE mrvmm.T_MAEM_INDICADOR_DATA ADD flag_revision VARCHAR2(1) default '0';
ALTER TABLE mrvmm.T_MAEM_INDICADOR_DATA ADD flag_verificacion VARCHAR2(1) default '0';

--Incorporacion de la columna v_decimal para verificar si es un decimal
--Incorporacion de la columna visible para verificar si el componente sera visible
--Incorporacion de la columna ENERGIA_TOTAL para verificar si es un componente de energia ahorrada
--Incorporacion de la columna VALIDAR_IMPLEMENTADO para verificar si fue implementado
--Incorporacion de la columna VALIDAR_FECHA_IMPLEM para verificar la fecha de implementacion
--Incorporacion de la columna VALIDAR_VERIFICACION para verificar si fue verificado
--Incorporacion de la columna VALIDAR_FECHA_VERIFI para verificar la fecha de verificacion
--Incorporacion de la columna FILTRO para verificar si el comoponente puede filtrar opciones
prompt Updating mrvmm.T_MAEM_MRV_PARAMETRO...
ALTER TABLE mrvmm.T_MAEM_MRV_PARAMETRO ADD v_decimal VARCHAR2(1) default '1';
ALTER TABLE mrvmm.T_MAEM_MRV_PARAMETRO ADD visible VARCHAR2(1) default '1';
ALTER TABLE mrvmm.T_MAEM_MRV_PARAMETRO ADD ENERGIA_TOTAL VARCHAR2(1) default '0';
ALTER TABLE mrvmm.T_MAEM_MRV_PARAMETRO ADD VALIDAR_IMPLEMENTADO VARCHAR2(1) default '0';
ALTER TABLE mrvmm.T_MAEM_MRV_PARAMETRO ADD VALIDAR_FECHA_IMPLEM VARCHAR2(1) default '0';
ALTER TABLE mrvmm.T_MAEM_MRV_PARAMETRO ADD VALIDAR_VERIFICACION VARCHAR2(1) default '0';
ALTER TABLE mrvmm.T_MAEM_MRV_PARAMETRO ADD VALIDAR_FECHA_VERIFI VARCHAR2(1) default '0';
ALTER TABLE mrvmm.T_MAEM_MRV_PARAMETRO ADD FILTRO VARCHAR2(1) default '0';

